/* Determine the cbs operation cycle time based on FG Number */


/* Find cbs cycle_time_selector */
string cbscycletimelookup = "";
cbscycletimelookup = "std";


/* Returns cycletime from Master FG List CSV */

string cbscycletimeselector = "";

cbscycletimeselector = cbscycletimelookup + "_op_time_min";
Inputs.var_op10time.Value = System.Convert.ToDecimal(PCLookUp.DataLookup("TENUK_FG_MasterTable", cbscycletimeselector, Inputs.var_fgnum.Value));

